    DECLARE done INT DEFAULT 0;
    DECLARE arac_id INT;
    DECLARE current_month DATE;
    DECLARE kiralama_tarihi DATE;
    DECLARE unique_check INT;
    DECLARE i INT;
    
    -- Cursor to fetch arac_id from sube_arac
    DECLARE cur CURSOR FOR
    SELECT arac_id FROM sube_arac;

    -- Continue if no error in fetching the cursor
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO arac_id;
        IF done THEN
            LEAVE read_loop;
        END IF;
        
        -- 2024 yılının her ayını dolaşalım
        SET current_month = '2024-01-01';

        WHILE current_month <= '2024-12-01' DO
            -- 5 ile 10 arasında rastgele kayıt ekleyelim
            SET i = 1;
            WHILE i <= (FLOOR(RAND() * 6) + 5) DO
                -- Benzersiz kiralama tarihi ve arac_id kontrolü
                SET kiralama_tarihi = DATE_ADD(current_month, INTERVAL FLOOR(RAND() * 30) DAY);
                
                -- Aynı tarih ve arac_id için kayıt var mı kontrol edelim
                SELECT COUNT(*) INTO unique_check
                FROM kiralama
                WHERE arac_id = arac_id AND kiralama_tarihi = kiralama_tarihi;
                
                -- Eğer aynı tarihte bir kayıt yoksa ekleyelim
                IF unique_check = 0 THEN
                    VALUES (arac_id, kiralama_tarihi);
                    SET i = i + 1;
                END IF;
            END WHILE;

            -- Bir sonraki aya geçelim
            SET current_month = DATE_ADD(current_month, INTERVAL 1 MONTH);
        END WHILE;
        
    END LOOP;

    CLOSE cur;
END$$

