DELIMITER $$
CREATE TRIGGER `hesapla_toplam_ucret` BEFORE INSERT ON `kiralama` FOR EACH ROW BEGIN
    DECLARE gun_farki INT;
    DECLARE gunluk_ucret DECIMAL(10, 2);

    -- bas_tarih ve bit_tarih arasındaki gün farkını hesapla
    SET gun_farki = DATEDIFF(NEW.bit_tarih, NEW.bas_tarih);

    -- sube_arac_id ile ilişkili aracın gunluk_ucret değerini al
    SELECT kirala.arac.gunluk_ucret
    INTO gunluk_ucret
    FROM kirala.sube_arac
    JOIN kirala.arac ON kirala.sube_arac.arac_id = kirala.arac.id
    WHERE kirala.sube_arac.id = NEW.sube_arac_id;

    -- Eğer tarih farkı sıfırsa (aynı gün), toplam_ucret sadece günlük ücret olur
    IF gun_farki = 0 THEN
        SET NEW.toplam_ucret = gunluk_ucret;
    ELSE
        -- Tarih farkı varsa toplam_ucret, gün farkı ile günlük ücretin çarpımı olur
        SET NEW.toplam_ucret = (gun_farki * gunluk_ucret);
    END IF;
END
$$
